import axios from "axios";

const feature = (url, method, type = "json") => {
  return new Promise((resolve, reject) => {
    switch (method) {
      case "get":
        resolve("nice");
        break;
      case "post":
        resolve("nice2");
        break;
      case "put":
        resolve("nice3");
        break;
      case "delete":
        resolve("nice4");
        break;
      default:
        resolve("nice5");
        break;
    }
  });
};

export default feature;
